import React, { Component, useState } from "react";
import axios from "axios";

class Temp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      lat: this.props.lat,
      lon: this.props.lon,
      temp: null,
      wind: null,
    };
  }
  getTempInfo = () => {
    axios
      .get(
        "http://api.openweathermap.org/data/2.5/weather?lat=49.203&lon=-122.9914&appid=8f61a1e09924a4c204d0927cfe0ff964"
        // "http://api.openweathermap.org/data/2.5/weather?lat=${props.lat}&lon=${props.lon}&appid=8f61a1e09924a4c204d0927cfe0ff964"
      )
      .then((response) => {
        let data = response.data;
        console.log(data);
        this.setState({
          temp: data.main.temp,
          wind: data.wind.speed,
        });
      })
      .catch((error) => {
        console.log(error);
      });
  };
  componentDidMount() {
    this.getTempInfo();
  }
  render() {
    return (
      <div>
        <p>Tempp: {this.state.temp}</p>
        <p>Wind: {this.state.wind}</p>
        <p>{this.state.lat}</p>
      </div>
    );
  }
}

export default Temp;
